import { Swiper, SwiperSlide } from "swiper/react";
import styles from "./Banner.module.css";
import { Navigation, Pagination, Autoplay } from "swiper";
import "swiper/css/navigation";
import "swiper/css/pagination";

const Banner = () => {
  return (
    <div className={styles.banner}>
      <div className={styles.banner_left}>
        <div className={styles.banner_left__img}>
          <img src={process.env.PUBLIC_URL + 'img/banner01.jpg'}/>
        </div>
        <div className={styles.banner_left__textbox}>
          <h2>Actuality<br/>Trends</h2>
          <small>Cozy Fall 2022</small>
          <div className={styles.banner_left__desc}>
            <span>The Cozy Architectural collection is everything a businesswoman could wish for. It knows no trends or seasons, making it a sleek, refined, and consistent selection of modern items that are made to stand the test of time.</span>
          </div>
        </div>
      </div>
      <div className={styles.banner_right}></div>
    </div>
  );
};
export default Banner;
